import React, { useState, useEffect } from 'react';

interface Player {
  id: string;
  name: string;
  country: string;
  rank: number;
  points: number;
}

interface ApiResponse {
  rankings: Array<{
    id: string;
    name: string;
    country: string;
    rank: number;
    points: number;
  }>;
}

const PlayersPage: React.FC = () => {
  const [players, setPlayers] = useState<Player[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchPlayers = async () => {
      try {
        const apiKey = 'mI0K6O5QLl4C7PBOxGl46rBnfaemkzs0SOVokjP';
        const url = `https://api.sportradar.com/golf/trial/v3/en/players/wgr/2025/rankings.json?api_key=${apiKey}`;

        const response = await fetch(url);

        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }

        const data: ApiResponse = await response.json();

        if (data.rankings && Array.isArray(data.rankings)) {
          setPlayers(data.rankings.slice(0, 20)); // Show top 20 players
        } else {
          throw new Error('Invalid data format');
        }
      } catch (err) {
        console.error('Error fetching players:', err);
        setError('Failed to load player data');
      } finally {
        setLoading(false);
      }
    };

    fetchPlayers();
  }, []);

  const renderPlayerCard = (player: Player | null, index: number) => (
    <div 
      key={index}
      style={{
        border: '1px solid #ddd',
        borderRadius: '8px',
        padding: '1.5rem',
        backgroundColor: '#f9f9f9',
        textAlign: 'center'
      }}
    >
      {player ? (
        <>
          <div style={{
            fontSize: '2rem',
            fontWeight: 'bold',
            color: '#2c5530',
            marginBottom: '0.5rem'
          }}>
            #{player.rank}
          </div>
          <h3 style={{
            margin: '0.5rem 0',
            color: '#333'
          }}>
            {player.name}
          </h3>
          <p style={{
            color: '#666',
            margin: '0.5rem 0'
          }}>
            {player.country}
          </p>
          <div style={{
            backgroundColor: '#2c5530',
            color: 'white',
            padding: '0.5rem',
            borderRadius: '4px',
            fontSize: '0.9rem'
          }}>
            {player.points} points
          </div>
        </>
      ) : (
        <>
          <div style={{
            fontSize: '2rem',
            fontWeight: 'bold',
            color: '#999',
            marginBottom: '0.5rem'
          }}>
            #--
          </div>
          <h3 style={{
            margin: '0.5rem 0',
            color: '#999'
          }}>
            TBD
          </h3>
          <p style={{
            color: '#999',
            margin: '0.5rem 0'
          }}>
            TBD
          </p>
          <div style={{
            backgroundColor: '#999',
            color: 'white',
            padding: '0.5rem',
            borderRadius: '4px',
            fontSize: '0.9rem'
          }}>
            TBD points
          </div>
        </>
      )}
    </div>
  );

  return (
    <div>
      <header style={{ textAlign: 'center', marginBottom: '2rem' }}>
        <h1 style={{ 
          fontSize: '2.5rem', 
          color: '#2c5530',
          marginBottom: '1rem'
        }}>
          World Golf Rankings
        </h1>
        <p style={{ 
          fontSize: '1.1rem', 
          color: '#666'
        }}>
          Current top players in professional golf
        </p>
      </header>

      {loading && (
        <div style={{ textAlign: 'center', padding: '2rem' }}>
          <p style={{ fontSize: '1.2rem', color: '#666' }}>Loading players...</p>
        </div>
      )}

      {error && (
        <div style={{ 
          textAlign: 'center', 
          padding: '2rem',
          backgroundColor: '#ffe6e6',
          border: '1px solid #ffb3b3',
          borderRadius: '8px',
          marginBottom: '2rem'
        }}>
          <p style={{ color: '#cc0000', fontSize: '1.1rem' }}>{error}</p>
        </div>
      )}

      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fill, minmax(280px, 1fr))',
        gap: '1.5rem',
        marginBottom: '2rem'
      }}>
        {Array(20).fill(null).map((_, index) => 
          renderPlayerCard(players[index] || null, index)
        )}
      </div>

      <footer style={{ 
        textAlign: 'center', 
        padding: '2rem 0',
        borderTop: '1px solid #eee',
        color: '#666'
      }}>
        <p>Data provided by Sportradar API</p>
      </footer>
    </div>
  );
};

export default PlayersPage;
